import { useEffect, useState } from "react";

function ItemList() {
const [issues, setIssues] = useState([]);

useEffect = () => {
  fetch("http://localhost:8080/tasks")
  .then(resp => resp.json())
}

return (
  <div>
    <h2>Список:
      <ul>
        {issues.map((user, index) => (
          <li key={index}>
            <p>Имя: {user.Name}</p> 
            <p>Чем занимается: {user.Do}</p>
          </li>
        ))}
      </ul>
    </h2>
  </div>
);
}

export default ItemList;
